import React, { Component } from 'react';
import Navbar2 from '../components/Navbar2';
import Navbar3 from '../components/Navbar3';


import CanvasJSReact from '../canva/canvasjs.react';
import CanvasJS from 'CanvasJSReact.CanvasJS';
import CanvasJSChart from 'CanvasJSReact.CanvasJSChart';

class Homepage extends Component {
    state = {  }
    render() { 
        const options = {
			animationEnabled: true,
			exportEnabled: true,
			theme: "light2", //"light1", "dark1", "dark2"
			title:{
				text: "Simple Column Chart with Index Labels"
			},
			data: [{
				type: "column", //change type to bar, line, area, pie, etc
				//indexLabel: "{y}", //Shows y value on all Data Points
				indexLabelFontColor: "#5A5757",
				indexLabelPlacement: "outside",
				dataPoints: [
					{ x: 10, y: 71 },
					{ x: 20, y: 55 },
					{ x: 30, y: 50 },
					{ x: 40, y: 65 },
					{ x: 50, y: 71 },
					{ x: 60, y: 68 },
					{ x: 70, y: 38 },
					{ x: 80, y: 92, indexLabel: "Highest" },
					{ x: 90, y: 54 },
					{ x: 100, y: 60 },
					{ x: 110, y: 21 },
					{ x: 120, y: 49 },
					{ x: 130, y: 36 }
				]
			}]
		}
        return ( 
            <section>
                <Navbar2/>
                <Navbar3/>
                <br/>
                <br/>
                <div className='container-fluid'>
                    <h3 className='text-center' style={{color:'#3D506B'}}>Grafik Nilai</h3>
                    <div className='row'>
                        <div className='col-8 mx-auto'>
                            <div className='card'>
                                <div style={{color:'white',backgroundColor:'#3D506B',borderRadius:'5px 5px 0 0'}} className='card-header col-12'>
                                    <h4>Statistik Nilai 13011XXXX</h4>
                                </div>
                                <div className='card-body'>
                                <CanvasJSChart options = {options}/>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
         );
    }
}

export default Homepage;
